import React, {useState} from 'react'
import MenuIcon from '@mui/icons-material/Menu';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import BarChartIcon from '@mui/icons-material/BarChart';
import AlarmIcon from '@mui/icons-material/Alarm';
import ErrorIcon from '@mui/icons-material/Error';
import PersonOffIcon from '@mui/icons-material/PersonOff';

const Dashboard = () => {
  const [showMessage, setShowMessage] = useState(false);

  const handleMenuClick = () => {
    setShowMessage(!showMessage);
  };

  return (
    <div className='w-3/4 text-black p-5 relative'>
        <div className='w-full bg-slate-900 text-white rounded-lg flex p-3 justify-between items-center'>
            <div className="flex items-center">
              <MenuIcon 
                className="cursor-pointer" 
                onClick={handleMenuClick}
              />
              {showMessage && (
                <span className="ml-3 font-medium">Feel Free To Ask</span>
              )}
            </div>
        </div>
        
        <div className='mt-5 pt-3 bg-slate-100 bg-opacity-50 grid gap-5 grid-cols-3 w-full pb-5 overflow-x-auto h-[80%]'>
          
          {/* Card blocks - with fixed height */}
          <div className='w-full h-48 border-2 bg-white rounded-lg cursor-pointer'>
            <div className='h-3 rounded-t-lg bg-gradient-to-r from-indigo-500 via-purple-500 to-pink-500'></div>
            <div className='h-[calc(100%-0.75rem)] py-7 px-5 flex flex-col justify-center items-center w-full text-center rounded-b-lg hover:bg-slate-900 hover:text-white'>
              <AccountCircleIcon sx={{color:'green', fontSize:"50px" }}/>
              <p className='text-xl my-3 font-semibold font-mono'>Joined Members</p>
            </div>
          </div>

          {/* Card blocks */}
          <div className='w-full h-48 border-2 bg-white rounded-lg cursor-pointer'>
            <div className='h-3 rounded-t-lg bg-gradient-to-r from-indigo-500 via-purple-500 to-pink-500'></div>
            <div className='h-[calc(100%-0.75rem)] py-7 px-5 flex flex-col justify-center items-center w-full text-center rounded-b-lg hover:bg-slate-900 hover:text-white'>
              <BarChartIcon sx={{color:'gold', fontSize:"50px" }}/>
              <p className='text-xl my-3 font-semibold font-mono'>Monthly Joined</p>
            </div>
          </div>

          {/* Card blocks */}
          <div className='w-full h-48 border-2 bg-white rounded-lg cursor-pointer'>
            <div className='h-3 rounded-t-lg bg-gradient-to-r from-indigo-500 via-purple-500 to-pink-500'></div>
            <div className='h-[calc(100%-0.75rem)] py-7 px-5 flex flex-col justify-center items-center w-full text-center rounded-b-lg hover:bg-slate-900 hover:text-white'>
              <AlarmIcon sx={{color:'red', fontSize:"50px" }}/>
              <p className='text-xl my-3 font-semibold font-mono'>Expiring withing 3 Days</p>
            </div>
          </div>

          {/* Card blocks */}
          <div className='w-full h-48 border-2 bg-white rounded-lg cursor-pointer'>
            <div className='h-3 rounded-t-lg bg-gradient-to-r from-indigo-500 via-purple-500 to-pink-500'></div>
            <div className='h-[calc(100%-0.75rem)] py-7 px-5 flex flex-col justify-center items-center w-full text-center rounded-b-lg hover:bg-slate-900 hover:text-white'>
              <AlarmIcon sx={{color:'red', fontSize:"50px" }}/>
              <p className='text-xl my-3 font-semibold font-mono'>Expiring withing 4-7 Days</p>
            </div>
          </div>

          {/* Card blocks */}
          <div className='w-full h-48 border-2 bg-white rounded-lg cursor-pointer'>
            <div className='h-3 rounded-t-lg bg-gradient-to-r from-indigo-500 via-purple-500 to-pink-500'></div>
            <div className='h-[calc(100%-0.75rem)] py-7 px-5 flex flex-col justify-center items-center w-full text-center rounded-b-lg hover:bg-slate-900 hover:text-white'>
              <ErrorIcon sx={{color:'red', fontSize:"50px" }}/>
              <p className='text-xl my-3 font-semibold font-mono'>Expired</p>
            </div>
          </div>

          {/* Card blocks */}
          <div className='w-full h-48 border-2 bg-white rounded-lg cursor-pointer'>
            <div className='h-3 rounded-t-lg bg-gradient-to-r from-indigo-500 via-purple-500 to-pink-500'></div>
            <div className='h-[calc(100%-0.75rem)] py-7 px-5 flex flex-col justify-center items-center w-full text-center rounded-b-lg hover:bg-slate-900 hover:text-white'>
              <PersonOffIcon sx={{color:'gray', fontSize:"50px" }}/>
              <p className='text-xl my-3 font-semibold font-mono'>Inactive members</p>
            </div>
          </div>
        </div>
    </div>
  )
}

export default Dashboard
